"use strict";async function clickedFeature(n){const r=n.layer.feature.id,e=`${mapConfig.featuresLayerDetailsUrlTemplate}${r}/`,t=await fetch(e),a=await t.json(),s=`\n    <p>\n        <strong>Tree type:</strong><br/>\n        ${a.art_latein}\n    </p>\n    <p>\n        <strong>Plantation year:</strong><br/>\n        ${a.pflanzjahr}\n    </p>\n    <p>\n        <strong>Stem circumference:</strong><br/>\n        ${a.stammumfang} cm\n    </p>\n    <p>\n        <strong>Crown diameter:</strong><br/>\n        ${a.kronendurchmesser} m\n    </p>\n    <p>\n        <strong>Address:</strong><br/>\n        ${a.address}<br/>\n        Hamburg, Germany\n    </p>`;map.openPopup(s,n.latlng,{offset:L.point(0,-1)})}